class Solution:
    #def prefixesDivBy5(self, A: List[int]) -> List[bool]:
    def prefixesDivBy5(self, A: list) -> list:
        res = []
        prefix = ''
        for i in A:
            prefix += (str(i))
            res.append(self._isDiv(5, int(prefix, 2)))
        return res
    
    def _isDiv(self, divisor: int, dividend: int)->bool:
        return not (dividend % divisor)

